import { Button, Container, Input} from "@mui/material";
import SendIcon from '@mui/icons-material/Send';

export function TextBar(){
    return<div>
        <Container maxWidth="xl" >
            <Input style={{ width: '50%',height: '400px' }} />
            <Button variant="contained">
                <SendIcon/>
            </Button>
        </Container>
    </div>
}
